import IDELayout from './ui/components/idelayout/IDELayout';
import { ThemeProvider } from './ThemeContext';
import './ui/styles/Themes.css';
import './App.css';

function App() {
    return (
        <ThemeProvider>
            <div className="ide-app">
                <IDELayout 
                    theme="island"
                    projectName="my-project"
                    projectIcon="MP"
                    projectColor="cobalt"
                    branchName="main"
                    runConfig="Development"
                />
            </div>
        </ThemeProvider>
    );
}

export default App;
